sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var tax=0;
var serviceTax=inputs.serviceTax;
if(serviceTax){
    serviceTax=serviceTax.RiderDetails;
    if(serviceTax){
       serviceTax.array_of_Rider.forEach(function(rider){
            tax= parseInt(rider.ServiceTax)+tax
       }) 
    }
}
tax=tax.toString().split(".")[0];
outputs.tax=tax;
})(inputs, outputs);

